  let productInfo = {title:"ProductList"}
  let categoryInfo = {title:"CategoryList"}

  return (
    <div>
      <Container>
        <Row>
          <Navi />
        </Row>
        <Row>
          <Col xs="3">
            <CategoryList info={categoryInfo}/>
          </Col>
          <Col xs="9">
            <ProductLists info={productInfo} />
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
